■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>歯に付着したヨゴレやヤニ取りに。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="610" valign="top" align="center"><div ><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0319/1192am-01.jpg" width="243" height="1200"></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><font size="3">【使用方法】<br>歯ぐき側から歯の咬合側にピックを移動させるように使用してください。</font></td></tr></table><br><br><div align='center'><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0319/1192am-02.jpg" width="121" height="1200"></div><br><div align='center'><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0319/1192am-03.jpg" width="125" height="373"><br><font size=3>角形状のピック</font></div><br><div align='center'><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0319/1192am-04.jpg" width="135" height="362"><br><font size=3>丸形状のピック</font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><br><font size="3">軽くこするだけで、歯に付着した歯垢やヤニ取りに力を発揮する、2種類のピックを両端にもっている歯の清掃具です。角形状のピックは、歯と歯の間と平らでない歯の表面部の歯垢に。丸形状のピックは、平らな歯の表面の歯垢除去に使用します。ピックは、歯の裏側の歯垢を除去しやすい湾曲形状です。</font></td></tr></table></td></tr></table><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">軽くこするだけで、歯に付着した歯垢やヤニ取りに力を発揮する、2種類のピックを両端にもっている歯の清掃具です。角形状のピックは、歯と歯の間と平らでない歯の表面部の歯垢に。丸形状のピックは、平らな歯の表面の歯垢除去に使用します。ピックは、歯の裏側の歯垢を除去しやすい湾曲形状です。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td width="75%" align="left"><font color="#333333" size="-1">1.5×16×0.7cm</font><br><font color="#333333" size="-1">個装サイズ：2×3×18cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">5g</font><br><font color="#333333" size="-1">個装重量：15g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">柄：ABS樹脂、ピック：ステンレス(SUS304)、保護チューブ：シリコンゴム</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--スペックここまで--><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
