■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>塗るだけで真っ白に魅せる歯のマニキュア!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="610" valign="top" align="center"><div ><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0304/1659al-01.jpg" width="600" height="600"></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><font size="3">・塗るだけで歯を真っ白に見せる歯のマニキュア<br><br>・塗って約10秒で乾くので、手早く歯のメイクができる<br><br>・マニキュアで歯の表面をコーティングするので、ステイン等による歯の着色汚れを防ぐ<br><br>・チョコレート、健康食品用のタブレットなどにも使用されている天然樹脂成分配合<br><br>・携帯に便利で塗りやすいペンタイプ<br><br>・歯磨きで簡単に落とすことができる<br><br>・マニキュアを初めて塗る時や慣れない時に、歯茎と唇の間に挟むとマニキュアが塗りやすくなる、天然コットン100％のデンタルコットン付き</font></td></tr></table><br><br><div align='center'><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0304/1659al-02.jpg" width="600" height="800"></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><br><font size="3">歯の表面に付いた汚れは歯磨きすれば落とせますが、歯自体は白くなりません。そこで、かんたん10秒白い歯メイク!口紅を塗るような手軽な感覚で簡単に塗ることができ、塗るだけで歯を白く見せるマニキュアです。メイクアップの仕上げは歯のマニキュアで!!</font></td></tr></table></td></tr></table><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">歯の表面に付いた汚れは歯磨きすれば落とせますが、歯自体は白くなりません。そこで、かんたん10秒白い歯メイク!口紅を塗るような手軽な感覚で簡単に塗ることができ、塗るだけで歯を白く見せるマニキュアです。メイクアップの仕上げは歯のマニキュアで!!</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">ペン:4ml、デンタルコットン:約4g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">ペン:16×110×16mm</font><br><font color="#333333" size="-1">個装サイズ：12×12×3cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">18g</font><br><font color="#333333" size="-1">個装重量：55g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">キャップ・容器:プラスチック、デンタルコットン:綿</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">成分</font></td><td align="left"><font color="#333333" size="-1">エタノール、ロジン、コパール、酸化チタン、マイカ、香料、(メタクリロイルオキシエチルカルボキシベタイン/メタクリル酸アルキル)コポリマー、セラック、ヒドロキシプロピルセルロース、ヒドロキシアパタイト、キシリトール、水、BG、アルミナ、シリカ、ローズマリーエキス、ローマカミツレエキス、チャエキス</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">1本約120回使用可能<br>保持:1回の使用で約12時間(個人差あり)<br>特許取得番号:4527666</font><br><font color="#333333" size="-1">商品区分：化粧品</font><br><font color="#333333" size="-1">販売業者：(株)ハニック・ホワイトラボ</font><br> </td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
